import "./header.css"

const Header = () => {
  return (
    <div className="header">
      <div className='headerList'>
        <div className='headerListItem'>
          <FontAwesomeIcon icon="fa-solid fa-spray-can-sparkles" />
        </div>
      </div>
    </div>
  )
}

export default Header
